import { Card } from "react-bootstrap";
import { latestRecord } from "../../Helpers/WeightTrackerHelpers";
import { WeightTrackerDifferenceProps } from "../../Interfaces/Weight";

function WeightTrackerDifference({data}: WeightTrackerDifferenceProps) {
  const latest = latestRecord(data!)!;
  const diff = (latest.currentWeight - latest.goalWeight).toFixed(2);

  return (
    <Card.Body>
      <Card.Title className="mb-3">Weight Difference</Card.Title>

      <span className="weight-difference">{diff} kg</span>
    </Card.Body>
  );
}

export default WeightTrackerDifference;
